import React from 'react';
import { Card, Container } from 'react-bootstrap';

const Main = () => {
    return (
        <Container>
            <div className='row'>
                <div className='col-6'>
                    <Card>
                        <Card.Body>
                            <h1>마지막으로 읽은 책</h1>
                        </Card.Body>
                    </Card>
                </div>
            </div>
        </Container>
    );
};

export default Main;
